import "./destination_style.css";


export default function Destination(){
    return(
        <div className="destination">
            <h1>Popular Destination</h1>
            <p>The most romantic destinations</p>
            <div className="first-des">
                <div className="des-text">
                    <h2>Great Barrier Island, New Zealand</h2>
                    <p>Imagine strolling hand in hand along the pristine shores of Great Barrier Island, the rhythmic melody of gentle waves serenading your every step. The golden sun dips below the horizon, casting hues of pink and orange across the vast canvas of the evening sky. As you breathe in the salty sea air, you feel a connection not just to each other, but to the untamed beauty that surrounds you.</p>
                </div>
                <div className="image"></div>
            </div>
        </div>
    );
}
